const pageConfig = {
    title: 'Quản lý sản phẩm công nghệ',
    apiBase: 'http://localhost:1337/api/product',
    fields: [
      { name: 'name', label: 'Tên sản phẩm', type: 'text' },
      { name: 'price', label: 'Giá', type: 'number' }
    ],
    permissions: {
      view: false,
      add: true,
      edit: true,
      delete: true
    }
  };
  
  export default pageConfig;
